// HOOKS
import { useSelector } from 'react-redux';
// ====================================
// COMPONTENTS
import Search from '../Header/Search';
// ====================================

const OverPage = () => {
    
    const { overPageContent } = useSelector( state => state.overPage );

    return(
        <div className="OverPage">
            { overPageContent === 'search' && <Search /> }
        </div>
    )
}
export default OverPage;
